import React, { useEffect, useState } from "react"

function Details() {
  let location = useLocation()
  let tempWeather = location.state.weather
  const [weather, setWeather] = useState({ ...tempWeather })
  return (
    <div>
      <div>Details</div>
      <div>{weather}</div>
    </div>
  )
}
export default Details
